import Link from 'next/link';

const linkStyle = {
    marginRight: 15
}

export default function Index() {
    return (
        <div>
            <Link href="/index">
                <a style={linkStyle}>Home</a>
            </Link>
            <Link href="/about">
                <a style={linkStyle}>About</a>
            </Link>
        </div>
    )
}
